import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <Nav />
    <Banner />
    <Convictions />
    <Banner2 />
    <About />
    <Banner3 />
    <Actions />
    <Banner4 />
    <ContactUs />
    <Footer />
  </div>
  );
}

export default App;
